    const handleShow = () => setShow(true);
  
    return (
      <>
        <Button variant="primary" onClick={handleShow}>
          GÃ¶nderi Hesapla
        </Button>
  
        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>
            <img src={require('../../images/calculator-img.png').default} alt="" className="img-fluid mr-4" />
           
                 
              
            </Modal.Title>
          </Modal.Header>
